import React from 'react';
import './card.css'

export default function Row({nombre , numero, equipo, url}) {
  
    return (
        <div class="card">
            <img src={url} alt="Avatar" style="width:100%"></img>
            <div class="container">
                <h5 class="card-title">{nombre}</h5>
                <p class="card-text">Su ultimo equipo fue {equipo} y su numero fue {numero}</p>
            </div>
        </div>
    );
}
